import { useState, useEffect } from 'react';
import axios from 'axios';
import '../App.css';

function UpdDelFlight() {
    const [listOfFlights, setListOfFlights] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/admin/showFlight")
        .then((result) => {
            setListOfFlights(result.data);
        })
        .catch((err) => {
            console.log(err);
        });
    }, []);

    return (
        <div className="">
          <div className="content">
              <h1>Flights</h1>

              <br/>






          </div>
        </div>

      );
}

export default UpdDelFlight;
